import React from 'react';
import { Form, Button } from 'react-bootstrap';
import './Register.css';

class Register extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            email: "",
            password: "",
            confirmPassord: "",
            role: ""
        }
    }

    render() {
        return (
            <div className="background">
                    <div className="container">
                      <div className="row">
                        <div className="col-md-4"></div>
                        <div className="col-md-5" style={{ height: "100vh" }}>
            
                          <form
                            className="form align-middle w-75"
                            style={{
                              position: "relative",
                              margin: "50%",
                              textAlign: "center"
                            }}
                          >
                            <h3>
                              <em>
                                Sign Up to People FreeLance
                            </em>
                            </h3>
            
                            <div className="form-group">
                              <Form.Group controlId="formBasicEmail">
                                <Form.Label style={{ float: "left" }}><h6><em>Email address</em></h6></Form.Label>
                                <Form.Control type="email" placeholder="Enter email" />
                              </Form.Group>
            
                              <Form.Group controlId="formBasicPassword">
                                <Form.Label style={{ float: "left" }}><h6><em>Password</em></h6></Form.Label>
                                <Form.Control type="password" placeholder="Password" />
                              </Form.Group>

                              <Form.Group controlId="formBasicPassword">
                                <Form.Label style={{ float: "left" }}><h6><em>Confirm password</em></h6></Form.Label>
                                <Form.Control type="password" placeholder="Confirm password" />
                              </Form.Group>

                              <Button color="primary">Sing Up</Button>{' '}
                            </div>
                          </form>
                        </div>
                      </div>
                    </div>
                  </div>
        )
    }
}
export default Register
